import React, { useState, useEffect } from 'react';
import logo from '../images/navlogo.png';
import { Link, useHistory, useLocation } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import decode from 'jwt-decode';
import * as actionType from '../constants/actionTypes';

function Navbar() {
	//set variables
	const dispatch = useDispatch();
	const location = useLocation();
	const history = useHistory();
	const [user, setUser] = useState(
		JSON.parse(localStorage.getItem('profile')),
	);

	//dispatch logout function for logout button
	const logout = () => {
		dispatch({ type: actionType.LOGOUT });
		alert('Logout successful');
		history.push('/');
		setUser(null);
	};

	//get user info for navbar, set auto-logout
	useEffect(() => {
		const token = user?.token;
		if (token) {
			const decodedToken = decode(token);

			if (decodedToken.exp * 1000 < new Date().getTime()) logout();
		}
		setUser(JSON.parse(localStorage.getItem('profile')));
	}, [location]);

	return (
		<>
			<a
				href='#'
				data-activates='slide-out'
				className='btn btn-primary p-3 button-collapse'
			>
				<i className='fas fa-bars'></i>
			</a>
			<div className='side-nav fixed wide sn-bg-1'>
				<ul className='custom-scrollbar'>
					<li>
						<div className='logo-wrapper sn-ad-avatar-wrapper'>
							<a href='/dashboard'>
								<img className='logo' src={logo} />
								<p>{user?.result?.name || 'Marissa'}</p>
							</a>
						</div>
					</li>
					<li>
						<ul className='collapsible collapsible-accordion'>
							<li>
								<a className='collapsible-header waves-effect arrow-r active'>
									<i className='sv-slim-icon fas fa-chevron-right'></i>
									Submit blog
									<i className='fas fa-angle-down rotate-icon'></i>
								</a>
								<div className='collapsible-body'>
									<ul>
										<li>
											<a
												href='#'
												className='waves-effect active'
											>
												<span className='sv-slim'>
													{' '}
													SL{' '}
												</span>
												<span className='sv-normal'>
													Submit listing
												</span>
											</a>
										</li>
										<li>
											<a
												href='#'
												className='waves-effect'
											>
												<span className='sv-slim'>
													{' '}
													RF{' '}
												</span>
												<span className='sv-normal'>
													Registration form
												</span>
											</a>
										</li>
									</ul>
								</div>
							</li>
							<li>
								<a id='toggle' className='waves-effect'>
									<i className='sv-slim-icon fas fa-angle-double-left'></i>
									Minimize menu
								</a>
							</li>
						</ul>
					</li>
				</ul>
				<div className='sidenav-bg rgba-blue-strong'></div>
			</div>
		</>
	);
}

export default Navbar;
